from math import gcd

def min_removals_to_increase_gcd(n, a):
    if n <= 2:
        return -1
    m = max(a) + 1
    prime = [0] * m
    cmd = [0] * m

    def sieve():
        for i in range(2, m):
            if prime[i] == 0:
                for j in range(2 * i, m, i):
                    prime[j] = i
        for i in range(2, m):
            if prime[i] == 0:
                prime[i] = i
    g = 0
    for num in a:
        g = gcd(num, g)
    sieve()
    ans = -1
    for num in a:
        ele = num // g
        while ele > 1:
            div = prime[ele]
            cmd[div] += 1
            while ele % div == 0:
                ele //= div
            ans = max(ans, cmd[div])
    if ans == -1:
        return -1
    return n - ans

